import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  // <React.StrictMode>
  <div className="min-h-screen h-full bg-white dark:bg-black text-black dark:text-white">
    <App />
  </div>
  // </React.StrictMode>
);

